import { useState } from "react";
import "../stylesheets/Home.css";
import GifSection from "../components/GifSection";
import GifUploader from "../components/GifUploader";


function Encrypt() {
    const [gifFile, setGifFile] = useState(null);


  return (
    <div className="home-container">
      <header className="home-header">
        <h1 className="home-title">Delving into Steganography</h1>
        <p className="home-subtitle">Explore & Discover</p>
      </header>

      <section className="home-cards">
        <div className="home-card">
          <h2>Project</h2>
        </div>

        <div className="home-card">
          <h2>Decrypt</h2>
        </div>
      </section>

      <GifSection />    {/* GIFUpload and FramePreview */}


          <div>
      <GifUploader onGifUpload={(binary, file) => setGifFile(file)} />
      {gifFile && <GifSection gifFile={gifFile} />}
    </div>


    </div>
  );
}

export default Encrypt;
